    const handleClick = (e) =>{
        console.log('button clicked',e);
    }

    const handleClickAgain=(name,e)=>{
        console.log('Hello '+ name,e.target);
    }
    return ( 
        <div className="Home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click Me</button>
            <button onClick={(e)=>handleClickAgain('loki',e)}>Click Me Again</button>
        </div>
     );
}

export default Home;
